// export default Card;

import React, { Component } from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import iphone from '../../img/11.jpg'
import samsung from '../../img/samsung.jpg'
import Moto from '../../img/moto.jpg'
import note from '../../img/note.jpg'
import oppo from '../../img/oppo.jpeg'
import milkpo from '../../img/milkpow.jpg'
import shoo from '../../img/s.jpg'
import ssss from '../../img/ssss.jpg'
import sevenrice from '../../img/7.jpg'
import '../../CSS/Style.css'
import "slick-carousel/slick/slick-theme.css";
export default function Mobile(){

      const settings = {
        
      dots: false,
      infinite: true,
      speed: 600,
      slidesToShow: 5,
      slidesToScroll: 1
    };

    const slidesData = [
        {
          image:iphone,
          name: 'I phone 11 ',
          pric:100000
        },
        {
            image :samsung,
            name: 'Samsung S15',
            pric:'15000' 
        },
        {
    
            image :Moto,
            name: 'Motorola G10',
            pric:'16000'
        }, {
            image :note,
            name: 'Redmi note 8 ',
            pric:18500
        }, {
      
            image :oppo,
            name: 'Oppo F15',
            pric:'32000 '
        },
        {
            image :milkpo,
            name: 'Milk Powder',
            pric:300
        },

        {
            image :sevenrice,
            name: '77 Rice',
            pric:1500
        },

      ];
    
    return (
      <div className="grocerysection">
            <div className="container">
                <div className="row">
                    <div className="col-md-1">
                  
                    </div>
                    <div className="col-md-2">
                        <h2 className="topoffer">Mobile Phone</h2>
                        <hr className="hrline"/>
                    </div>
            </div>
      </div>
            <Slider {...settings} className="slickimg ">
                {slidesData.map((slide) =>
                    <div className="slick-slide">
                        <img src={slide.image} className="imggs" />
                        <p class="procutname">{slide.name}</p>
                        <p className="" id="price">Rs. {slide.pric}</p>
                    </div>
                )}
            </Slider>
      </div>
    );
  
}
